<template>
	<view class="security-container">
		<view class="banner">
			<view class="img">
				<image src="@/static/images/user/logo.png" mode=""></image>
			</view>
			<text class="title">有赞安全中心智能守护你的帐号安全</text>
		</view>
		<van-cell title="注销账号" @tap="delUser" is-link label="提交申请，删除所有数据，注销帐号" />

		<van-cell title="常见问题" is-link label="点击可查看相关安全问题" />

		<van-cell title="用户服务协议" is-link />
		<van-cell title="用户隐私政策" is-link />
	</view>
</template>

<script>
	export default {
		data() {
			return {

			};
		},
		methods: {

			delUser() {
				var _this = this
				uni.showModal({
					content: "确定要注销吗?",
					success(e) {

						if (e.cancel === true) {
							return
						} else {
							_this.$store.commit("delUser")
							if (_this.$store.state.user == "") {
								uni.switchTab({
									url: "/pages/user/user"
								})
								uni.showToast({
									title: "注销成功"
								})

							}
						}
					}
				})


			}
		}
	}
</script>

